var lazyLoad_1 = false;
var lazyLoad_2 = false;
var lazyLoad_iframes = false;
var lazyload_initial_device = false;
var lazyloadProccess = function() {
  var a = new LazyLoad({
    elements_selector: "iframe",
    data_src: "original"
  });
  if (isMobile()) {
    lazyLoad_1 = new LazyLoad({
      elements_selector: ".i-lazy:not([data-mobile])",
      data_src: "original"
    });
    lazyLoad_2 = new LazyLoad({
      elements_selector: ".i-lazy[data-mobile]",
      data_src: "mobile",
      data_srcset: "srcset-mobile"
    });
  } else {
    if (isMid()) {
      lazyLoad_1 = new LazyLoad({
        elements_selector: ".i-lazy:not([data-mid])",
        data_src: "original"
      });
      lazyLoad_2 = new LazyLoad({
        elements_selector: ".i-lazy[data-mid]",
        data_src: "mid"
      });
    } else {
      lazyLoad_1 = new LazyLoad({
        elements_selector: ".i-lazy",
        data_src: "original"
      });
    }
  }
};
var updateLazyload = function(a) {
  lazyLoad_1.update();
  if (lazyLoad_2) {
    lazyLoad_2.update();
  }
  if (isIE() || isMSEdge()) {
    $(a).find(".i-lazy").each(function(b) {
      $(this).css("background-image", "url(" + $(this).attr("data-original") + ")");
    });
    if (isIE()) {
      if (!$(a).hasClass("modal_video")) {
        $(a).find(".modal__close").css("background-image", "url(css/images/modal/close.svg?v=2)");
      } else {
        $(a).find(".modal__close").css("background-image", "url(css/images/modal/close_white.svg?v=2)");
      }
    }
  }
};
